cccaComponentTable = MibTable((1, 3, 6, 1, 4, 1, 9, 9, 473, 1, 2, 2), )
if mibBuilder.loadTexts: cccaComponentTable.setStatus('current')
if mibBuilder.loadTexts: cccaComponentTable.setDescription('The component table is a list of enterprise contact center application functional components. A contact center application solution includes a collection of interconnected functional components (e.g. a router, a logger and a peripheral gateway), each of which perform a specific, necessary function of the contact center application. This table enumerates and lists all contact center application functional components installed and configured on this server. A single server is permitted to have multiple functional components of a different type, but also multiple components of the same type. This table has an expansion relationship with the instance table; there will be one or many entries in this table that relate to a single entry in the instance table. The component table is indexed by two different values: the primary index is the instance index; the secondary index is a unique identifier for each functional component. This component index is arbitrarily assigned by the SNMP agent. These same index values are used in the individual component information tables, thus, the individual component information tables have a sparse dependency relationship with this table. The SNMP agent constructs the component table at startup. Since components can only be configured while the enterprise contact center application is stopped, component table entries cannot be added to or deleted from the table. Object values can be modified by the agent but not the management station. All objects in this table are read-only to the management station.')
