if mibBuilder.loadTexts: cccaCampaignMgrEntry.setDescription('Each campaign manager entry represents an enterprise contact center application Outbound Option Campaign Manager server functional component configured on this server. The campaign manager component, which resides on the ICM/CC logger (side A), is responsible for: - Managing when a campaign runs. - Maintaining system and dialer configurations. - Making decisions about which contact records to retrieve from a campaign based upon configurable query rules and then delivering those contact records to dialers. - Distributing configuration data to the import process and all available dialers in the system. - Collecting real-time and historical data and sending it to the Router for subsequent storage and distribution. - Managing the Do Not Call list, ensuring no numbers on it are sent to the Dialers. The objects in each campaign manager entry provide configuration, performance and component status information.')
