if mibBuilder.loadTexts: cccaEventState.setDescription("The event state object identifies the state (not to be confused with severity) of the notification and potentially the current state of the functional component that generated the notification. The possible states are: 'clear': The clear state indicates that the condition which generated a previous raise notification has been resolved. 'applicationError': The application error state alerts the recipient that an error exists in the enterprise contact center application but that the error does not affect the operational status of the functional component. 'raise': A raise state identifies a notification received as a result of a health-impacting condition, such as a process failure. A subsequent clear state notification will follow when the error condition is resolved. 'singleStateRaise': The single state raise state indicates that a health-impacting error has occurred and that a subsequent clear state notification will not be forthcoming. An example of a single state raise condition is an application configuration error that requires the system to be stopped and the problem resolved by an administrator before the affected component will function properly.")
