if mibBuilder.loadTexts: cccaEventOriginatingNodeType.setDescription("The event originating node type indicates the type of enterprise contact center application functional component or subcomponent that generated this notification. The node types are: 'unknown': The notification originates from an unknown source. 'router': The notification was generated by the router functional component. 'pg': The notification was generated by the peripheral gateway functional component. 'nic': The notification was generated by the network interface controller functional component. 'aw': The notification was generated by the administrator workstation functional component. 'logger': The notification was generated by the logger functional component. 'listener': The notification was generated by the listener functional component. The listener is an enterprise contact center application process that collects event messages from the logger for display in a Cisco proprietary event management application that is part of the Remote Management Suite (RMS). 'cg': The notification was generated by the CTI gateway functional component. 'ba': The notification was generated by the Blended Agent functional component. Blended Agent is an enterprise contact center 'outbound option' functional component that manages campaigns of outbound dialing.")
